import React, { useState } from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import './App.css';
import Google from './components/googleLogin'
import InputCollaborateur from './components/inputCollaborateur';
import Rh from './components/rh'



function App() {

  const [collabo, setCollabo] = useState({})
  console.log(collabo, ' State APPS JS');
  const handleCollabo = collabo => { setCollabo(collabo) }

  return (
    <Router>
      <div>
        <Switch>
          <Route exact path='/'><Google collabo={collabo} /></Route>
          {/* <Route exact path='/redirect/:email'><Redirection /></Route> */}
          {collabo !== true ? <Route exact path='/collaborateur/:prenom/:nom'><InputCollaborateur collabo={collabo => handleCollabo(collabo)} /></Route> : <Route exact path='/rh'><Rh /></Route>}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
